def clean_load_thru(load,thru):
    selected_i=[]
    for i in range(0,len(load)):
        if load[i]!=0:
            if thru[i] > load[i]:
                thru[i]=load[i]
            selected_i.append(i)

    load = [load[i]/1e9 for i in selected_i]
    load.insert(0,0)
    thru = [thru[i]/1e9 for i in selected_i]
    thru.insert(0,0)
    return load,thru
